import React, {Component} from "react";
import firebase from "firebase/app";
import "./CheckBox.css";

class CheckBox extends Component {
  constructor(props) {
    super(props);
    this.state = {
      check: true,
    };
    this.initial_value = this.initial_value.bind(this);
  }

  render() {
    return (
      <div>
        <form className="check_box" name="check_box">
          <input type="checkbox" name="boxes" checked={this.state.check} />
        </form>
      </div>
    );
  }
}
export default CheckBox;
